import React, { useEffect, useRef } from 'react'
import * as echarts from 'echarts'
import { px } from '../shared/px'
import { baseEchartOptions } from '../shared/base-echarts-options'
import { createEchartsOptions } from '../shared/create-echarts-options'
export const Chart2 = () => {
  const divRef = useRef(null)
  const myChart = useRef(null)
  const data = [
    { name: '城关区公安局', 2011: 2, 2012: 3 },
    { name: '七里河区公安局', 2011: 2, 2012: 3 },
    { name: '西固区公安局', 2011: 2, 2012: 3 },
    { name: '安宁区公安局', 2011: 2, 2012: 3 },
    { name: '红古区公安局', 2011: 2, 2012: 3 },
    { name: '永登县公安局', 2011: 2, 2012: 3 },
    { name: '皋兰县公安局', 2011: 2, 2012: 3 },
    { name: '榆中县公安局', 2011: 2, 2012: 3 },
    { name: '新区公安局', 2011: 2, 2012: 3 },
  ]
  useEffect(() => {
    setInterval(() => {
      const newData = [
        { name: '城关区公安局', 2011: 2, 2012: Math.random() * 10 },
        { name: '七里河区公安局', 2011: 2, 2012: 3 },
        { name: '西固区公安局', 2011: 2, 2012: 3 },
        { name: '安宁区公安局', 2011: 2, 2012: 3 },
        { name: '红古区公安局', 2011: 2, 2012: 3 },
        { name: '永登县公安局', 2011: 2, 2012: 3 },
        { name: '皋兰县公安局', 2011: 2, 2012: 3 },
        { name: '榆中县公安局', 2011: 2, 2012: 3 },
        { name: '新区公安局', 2011: 2, 2012: 3 },
      ]
      x(newData)
    }, 2000)
  }, [])

  const x = (data) => {
    myChart.current.setOption(
      createEchartsOptions({
        ...baseEchartOptions,

        grid: {
          x: px(100),
          y: px(40),
          x2: px(40),
          y2: px(40),
        },

        xAxis: {
          boundaryGap: [0, 0.01],
          splitLine: { show: false },
          axisLabel: { show: false },
          type: 'value',
        },
        yAxis: {
          type: 'category',
          data: data.map((i) => i.name),
          axisLabel: {
            formatter(val) {
              return val.replace('公安局', '\n公安局')
            },
          },

          axisTick: {
            show: false,
          },
        },

        series: [
          {
            name: '2011',
            type: 'bar',
            data: data.map((i) => i[2011]),
            itemStyle: {
              normal: {
                color: new echarts.graphic.LinearGradient(0, 0, 1, 0, [
                  {
                    offset: 0,
                    color: '#2034F9',
                  },
                  {
                    offset: 1,
                    color: '#04A1FF',
                  },
                ]),
              },
            },
          },
          {
            name: '2012',
            type: 'bar',
            data: data.map((i) => i[2012]),
            itemStyle: {
              normal: {
                color: new echarts.graphic.LinearGradient(0, 0, 1, 0, [
                  {
                    offset: 0,
                    color: '#B92AE8',
                  },
                  {
                    offset: 1,
                    color: '#6773E7',
                  },
                ]),
              },
            },
          },
        ],
      }),
    )
  }
  useEffect(() => {
    myChart.current = echarts.init(divRef.current)
    x(data)
  }, [])

  return (
    <div className="bordered 破获排名">
      <h2>案件破获排名</h2>
      <div ref={divRef} className="chart" />
      <div className="legend">
        <span className="first" /> 破案排名
        <span className="second" /> 破案时间
      </div>
    </div>
  )
}
